import Vue from "vue"
import VueRouter from "vue-router"

Vue.use(VueRouter)

const routes = [
    {
        path: "/",
        name: 'Main',
        component: () => import('views/Main')
    },
    {
        path: '/login',
        name: 'login',
        component: () => import('views/login/Login')
    }

]

const router = new VueRouter({
    mode: "history",
    routes
})
export default router;
